// ETH Page -- Sparkline
// Author: Samuel Adamson
import axios from 'axios';
import { Component } from 'react';
import { Container, ToggleButtonGroup, ToggleButton } from 'react-bootstrap';
import { Line } from 'react-chartjs-2';

class EthSpark extends Component {
    constructor() {
        super();
        this.state = {
            ethSpark: { day: null, week: null, month: null, year: null}
        };
    };




    render() {
        return(
            <div className="EthSpark spark">
                <Container className = "mt-5 mb-5">
                    <ToggleButtonGroup type="radio" name="options" defaultValue={0}>
                        <ToggleButton id="tbg-radio-0" size="lg" value={0}> 1D </ToggleButton>
                        <ToggleButton id="tbg-radio-1" value={1}> 1W </ToggleButton>
                        <ToggleButton id="tbg-radio-2" value={2}> 1M </ToggleButton>
                        <ToggleButton id="tbg-radio-3" value={3}> 1Y </ToggleButton>
                    </ToggleButtonGroup>
                </Container>
            </div>
        );
    }
}

export default EthSpark;
